import React from 'react';

const Label = ({ error, className, children, labelFor,...props }) => {
    return (
        <div>
        <label for="pwd">Password:</label>

<label htmlFor={labelFor} className="label" {...props}>
    {children}
</label>
        </div>

    );
};

export default Label;
